import React from 'react';
import './Menu.css'; 

const Menu = () => {
  return (
    <div>
      <div className="heading">
        <h2>Cochin University of Science and Technology</h2>
        <div className="para">
        <p>Cochin University of Science and Technology (CUSAT) was initially constituted as the University of Cochin through an Act of Kerala Government on 10th July 1971. The University of Cochin was re‐constituted as Cochin University of Science and Technology (CUSAT) in February 1986, redefining its objectives as "promoting Graduate and Post‐Graduate studies and Advanced Research in Applied Sciences, Technology, Industry, Commerce, Management and Social Sciences." CUSAT is now a world-ranking university with the specific purpose of developing higher education, emphasizing post-graduate studies and research in applied science, technology, industry, humanities, and commerce. CUSAT has consecutively been figured in the Times Higher Education World Ranking since 2017. The Times ranks around 1500 best universities worldwide annually with around 60 universities from India out of 967. CUSAT has also found a place in the QS World University Ranking and the National Institutional Ranking Framework (NIRF) of the India Government.</p>
        <p>CUSAT Kochi provides UG, PG, diploma, certificate, and research courses in applied Sciences, technology, Industry, commerce, management, law, and social sciences. Riding on its state-of-art facilities and expert teaching staff, the institution is on a mission to generate a human resource of global competence. It delivers advanced knowledge and modern training to prepare its students for the modern industry. Moreover, it upholds the culture of fostering creative thinking and innovation in its students. </p>
      </div>
      </div>
    </div>
  );
};

export default Menu;
